import { SET_OBRA_SOCIAL } from "actions/types";
const initialState = {
  obraSocial: "",
};

export default function (state = initialState, action) {
  switch (action.type) {
    case SET_OBRA_SOCIAL:
      return {
        ...state,
        obraSocial: action.payload,
      };

    default:
      return state;
  }
}
